sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
function evaluateProperty({api, helpers}) {
  var datesJSONObj=api.data.get_dates_resource.results;

  var lengthOfJSONObj=datesJSONObj.length;

  //getting last record due date
  var lastRecordDueDate=api.data.get_dates_resource.results[lengthOfJSONObj-1].due_date.value;

	return lastRecordDueDate;
}
